-- Genre Table
MERGE INTO Genre g
USING (SELECT 1 AS GenreID, 'Fiction' AS GenreName FROM dual UNION ALL
	   SELECT 2, 'Non-Fiction' FROM dual UNION ALL
	   SELECT 3, 'Fantasy' FROM dual UNION ALL
	   SELECT 4, 'Romance' FROM dual UNION ALL
	   SELECT 5, 'Mystery' FROM dual UNION ALL
	   SELECT 6, 'Horror' FROM dual UNION ALL
	   SELECT 7, 'Science Fiction' FROM dual UNION ALL
	   SELECT 8, 'History' FROM dual UNION ALL
	   SELECT 9, 'Crime' FROM dual UNION ALL
	   SELECT 10, 'Comedy' FROM dual) src
ON (g.GenreID = src.GenreID)
WHEN MATCHED THEN
  UPDATE SET g.GenreName = src.GenreName
WHEN NOT MATCHED THEN
  INSERT (GenreID, GenreName) VALUES (src.GenreID, src.GenreName);

